// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BubbleAchievements {
    struct Player {
        string name;
        string favoriteColor;
        uint256 favoriteNumber;
        bool isActive;
    }

    struct Achievement {
        uint256 timestamp;
        string letter;
        uint256 gameId;
        bool isSpecial;
    }

    mapping(string => Player) public players;        // playerID => Player (now using name-color-number as ID)
    mapping(string => Achievement[]) public playerAchievements;  // playerID => Achievements
    mapping(string => mapping(string => bool)) public lettersPopped;
    mapping(string => uint256) public totalPops;

    event PlayerRegistered(string playerId, string name);
    event BubblePopped(string playerId, string letter, uint256 gameId, uint256 timestamp);
    event SpecialAchievement(string playerId, string achievement, uint256 timestamp);

    function registerPlayer(
        string memory name,
        string memory favoriteColor,
        uint256 favoriteNumber
    ) public returns (string memory) {
        string memory playerId = string(abi.encodePacked(name, "-", favoriteColor, "-", toString(favoriteNumber)));

        players[playerId] = Player({
            name: name,
            favoriteColor: favoriteColor,
            favoriteNumber: favoriteNumber,
            isActive: true
        });

        emit PlayerRegistered(playerId, name);
        return playerId;
    }

    function recordPop(string memory playerId, string memory letter, uint256 gameId) public {
        require(players[playerId].isActive, "Player not found");

        Achievement memory newAchievement = Achievement({
            timestamp: block.timestamp,
            letter: letter,
            gameId: gameId,
            isSpecial: !lettersPopped[playerId][letter]
        });

        playerAchievements[playerId].push(newAchievement);
        totalPops[playerId]++;

        if (!lettersPopped[playerId][letter]) {
            lettersPopped[playerId][letter] = true;
            emit SpecialAchievement(playerId, 
                string(abi.encodePacked("First time popping letter ", letter, "!")), 
                block.timestamp
            );
        }

        emit BubblePopped(playerId, letter, gameId, block.timestamp);
        checkMilestones(playerId);
    }

    function checkMilestones(string memory playerId) internal {
        uint256 pops = totalPops[playerId];
        if (pops == 10) {
            emit SpecialAchievement(playerId, "Popped 10 bubbles!", block.timestamp);
        } else if (pops == 50) {
            emit SpecialAchievement(playerId, "Bubble Pop Star - 50 pops!", block.timestamp);
        } else if (pops == 100) {
            emit SpecialAchievement(playerId, "Bubble Pop Champion - 100 pops!", block.timestamp);
        }
    }

    function getPlayerAchievements(string memory playerId) public view returns (Achievement[] memory) {
        require(players[playerId].isActive, "Player not found");
        return playerAchievements[playerId];
    }

    function getUniqueLettersPopped(string memory playerId) public view returns (uint256 count) {
        require(players[playerId].isActive, "Player not found");
        string memory alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
        bytes memory alphabetBytes = bytes(alphabet);
        for (uint i = 0; i < alphabetBytes.length; i++) {
            string memory letter = string(abi.encodePacked(alphabetBytes[i]));
            if (lettersPopped[playerId][letter]) {
                count++;
            }
        }
        return count;
    }

    function toString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}

