// contracts/MusicSequence.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MusicSequence {
    struct Player {
        string name;
        string favoriteColor;
        uint256 favoriteNumber;
        bool isActive;
        uint256 currentLevel;
        uint256[] currentSequence;
        uint256 sequencePosition;
    }

    mapping(string => Player) public players;
    mapping(uint256 => uint256[]) public levelSequences;

    event PlayerRegistered(string playerId, string name);
    event SequenceStarted(string playerId, uint256 level);
    event NoteAttempted(string playerId, uint256 note, bool correct);
    event LevelCompleted(string playerId, uint256 level);

    function registerPlayer(
        string memory name,
        string memory favoriteColor,
        uint256 favoriteNumber
    ) public returns (string memory) {
        string memory playerId = string(abi.encodePacked(name, "-", favoriteColor, "-", toString(favoriteNumber)));

        players[playerId] = Player({
            name: name,
            favoriteColor: favoriteColor,
            favoriteNumber: favoriteNumber,
            isActive: true,
            currentLevel: 1,
            currentSequence: new uint256[](0),
            sequencePosition: 0
        });

        emit PlayerRegistered(playerId, name);
        return playerId;
    }

    function startNewSequence(string memory playerId) public {
        require(players[playerId].isActive, "Player not found");
        Player storage player = players[playerId];

        uint256[] memory newSequence = new uint256[](player.currentLevel);
        for(uint256 i = 0; i < player.currentLevel; i++) {
            newSequence[i] = uint256(keccak256(abi.encodePacked(block.timestamp, i))) % 8 + 1;
        }

        levelSequences[player.currentLevel] = newSequence;
        player.currentSequence = newSequence;
        player.sequencePosition = 0;

        emit SequenceStarted(playerId, player.currentLevel);
    }

    function attemptNote(string memory playerId, uint256 note) public {
        require(players[playerId].isActive, "Player not found");
        Player storage player = players[playerId];

        bool correct = note == player.currentSequence[player.sequencePosition];
        emit NoteAttempted(playerId, note, correct);

        if (!correct) {
            player.sequencePosition = 0;
            return;
        }

        player.sequencePosition++;

        if (player.sequencePosition == player.currentSequence.length) {
            player.currentLevel++;
            player.sequencePosition = 0;
            emit LevelCompleted(playerId, player.currentLevel - 1);
        }
    }

    function getCurrentLevel(string memory playerId) public view returns (uint256) {
        require(players[playerId].isActive, "Player not found");
        return players[playerId].currentLevel;
    }

    function getCurrentSequence(string memory playerId) public view returns (uint256[] memory) {
        require(players[playerId].isActive, "Player not found");
        return players[playerId].currentSequence;
    }

    function toString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}
